function windowResizeTimer(){$(window).width()>1200?document.getElementById("head1").style.marginLeft=$(window).width()/2-230+"px":document.getElementById("head1").style.marginLeft="0px"}$(document).ready(function(){$("[data-bs-hover-animate]").mouseenter(function(){var e=$(this);e.addClass("animated "+e.attr("data-bs-hover-animate"))}).mouseleave(function(){var e=$(this);e.removeClass("animated "+e.attr("data-bs-hover-animate"))})}),myVar=window.setInterval(windowResizeTimer,500);